// export default App;
import React from 'react';
import './FrontPage.css';

const columns = [
    { key: 'firstName', label: 'FIRSTNAME' },
    { key: 'lastName', label: 'LASTNAME' },
    { key: 'email', label: 'EMAIL' },
    { key: 'mobileNumber', label: 'MOBILENUMBER' },
    { key: 'dob', label: 'DOB' },
];

const data = [
    { firstName: "Anom", lastName: "Doe", email: "anom@example.com", mobileNumber: "1234567890", dob: "2004-01-01" },
    { firstName: "Megha", lastName: "Smith", email: "megha@example.com", mobileNumber: "9876543210", dob: "2004-02-15" },
    { firstName: "Subham", lastName: "Johnson", email: "subham@example.com", mobileNumber: "5555555555", dob: "1998-06-30" },
    // Add more rows as needed
];

function App() {
    return (
        <div className="App">
            <div className="logo">
                <img id="logo1" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg" alt="Logo" />
            </div>
            <table>
                <thead>
                    <tr>
                        {columns.map(column => (
                            <th key={column.key}>{column.label}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {data.map((row, rowIndex) => (
                        <tr key={rowIndex}>
                            {columns.map(column => (
                                <td key={column.key}>{row[column.key]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
            <div className="btn">
                <button>ADD</button>
            </div>
        </div>
    );
}

export default App;
